import Header from './Header';
import BlockAdvice from './BlockAdvice';

class Wrapper extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div id="wrapper">
                <div className="wrapper-holder">
                    <section id="main">
                        <Header />
                        <SlideShow />
                        <Boxes />
                        <BlockAdvice />
                    </section>
                </div>
                <Footer />
            </div>
         );
    }
}

export default Wrapper;
